import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <nav>
        <ul>
          <span><li>Inmobilaw</li></span>
          <span>
            <li>
              Home
            </li>
            <li>
              Newsletter
            </li>

            <li>sobreNosotros</li>

            <li>
              Contacto
            </li>

          </span>
        </ul>
      </nav>
    </div>
  );
}

export default App;
